package org.JavaLearning;

//single inheritance parent class

public class Single_Inheritance_Parent {

	public void floor1() {
		System.out.println("IT Consulting");

	}

	public void floor2() {
		System.out.println("Development Department");

	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Single_Inheritance_Parent office = new Single_Inheritance_Parent();
		office.floor1();
		office.floor2();
	}

}
